import React, {useState, useEffect} from "react";
import Base from "../core/Base";
import SearchBox from "./Searcbox";
import {fetchFavs} from "../home/searchHelper/FetchInfoHelper";

const Test = () => {

  const [favs, setFavs] = useState({
    result: []
  });

  const { result } = favs;

  useEffect(() => {
    fetchFavs()
    .then((data) => {
      if(data.error){
        setFavs({...favs, result: []})
      }
      else{
        setFavs({...favs, result: data})
      }
    })
    .catch((err) => {
      console.log(err)
    })
  },[])


  return(
    <Base>
    <div className="row">
      <div className="container">
        <div className="col-md-12">
          <div className="text-center sitename">
            <h1>Riafy Stockz</h1>
            <p className="">
              "Stock analysis and screening tool for investors in India."
            </p>
            <SearchBox />
            <div className="favlist mt-4">
              <div className="row"> 
                <ul>
              {
                  result.map((value, idx) => (
                    <li key="idx"> dddd</li>
                  ))
                }
                </ul>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  </Base>
  )

};

export default Test;
